import os
from collections import defaultdict, Counter
from heapq import heapify, heappop, heappush, heappushpop
import sys
sys.setrecursionlimit(150000)


def read_input() -> "list[str]":
    input: list[str] = []
    here = os.path.dirname(os.path.abspath(__file__))

    filename = os.path.join(here, 'input.txt')
    with open(filename) as file:
        for line in file:
            input.append(line.strip())
    return input


def convert_line_to_nums(line):
    return [int(x) for x in line.split()]


def read_input_converted(input):
    return [convert_line_to_nums(line) for line in input]


def part1():
    input = read_input()
    robots = []
    for line in input:
        px = int(line.split('p=')[1].split(',')[0])
        py = int(line.split('p=')[1].split(',')[1].split('v=')[0].strip())
        vx = int(line.split('p=')[1].split(',')[1].split('v=')[1])
        vy = int(line.split('p=')[1].split(',')[2])
        robots.append([px, py, vx, vy])
    xl = 101
    yl = 103
    for _ in range(100):
        for i, (px, py, vx, vy) in enumerate(robots):
            px += vx
            py += vy
            px %= xl
            py %= yl
            robots[i] = [px, py, vx, vy]
    q1, q2, q3, q4 = 0, 0, 0, 0
    for x, y in [[x[0], x[1]] for x in robots]:
        if x < xl // 2 and y < yl//2:
            q1 += 1
        elif x > xl//2 and y < yl//2:
            q2 += 1
        elif x < xl//2 and y > yl//2:
            q3 += 1
        elif x > xl//2 and y > yl//2:
            q4 += 1
    print(q1, q2, q3, q4)
    print(q1*q2*q3*q4)


def part2():
    input = read_input()
    robots = []
    for line in input:
        px = int(line.split('p=')[1].split(',')[0])
        py = int(line.split('p=')[1].split(',')[1].split('v=')[0].strip())
        vx = int(line.split('p=')[1].split(',')[1].split('v=')[1])
        vy = int(line.split('p=')[1].split(',')[2])
        robots.append([px, py, vx, vy])
    xl = 101
    yl = 103
    for j in range(10000):
        for i, (px, py, vx, vy) in enumerate(robots):
            px += vx
            py += vy
            px %= xl
            py %= yl
            robots[i] = [px, py, vx, vy]
        matrix = [['.' for _ in range(xl)] for _ in range(yl)]

        for r in robots:
            px, py, _, _ = r
            matrix[py][px] = '#'
        for r in matrix:
            if sum([1 if x == '#' else 0 for x in r]) > 32:
                for k in matrix:
                    print(k)
                print('min time', j+1)
                print('\n')


part1()
part2()

